import time
import random
print("Welcome to TRY TO GET 1 Beta! How the game works: The program guess a number between 1 and like 90000000000000000000 million and if you get 1 I may buy you the hacker plan on repl.it!")
print("Enter your username")
name = input()
def start():
  number = random.randint(0,)
  if number == 1:
    print("You did it! Your number is 1! Adding you to database!")
    database = open("highscores.txt","a")
    database.write(name + "\n")
    database.close()
  else:
    print("Nope your number was",number)
while(True):
  start()
  print("Do you want to start again? (y,n)")
  y = input()
  if(y == "y"):
    start()
  elif y == "n":
    print("Ok! Bye!")
    break
  else:
    start()